A Prairie Home Companion, February 8, 2014 Show #1432: &quot;Nothing but the Blues&quot;

This week on A Prairie Home Companion with Garrison Keillor, the first of our winter rebroadcasts, originally from May 2013 at the Ryman Auditorium in Nashville, Tennessee. The Time Jumpers play &quot;Six Pack to Go,&quot; Suzy Bogguss sings &quot;I Always Get Lucky with You,&quot; and Stuart Duncan joins The Guy's All-Star Shoe Band for a medley of fiddle tunes. In Lake Wobegon, it's time for the fishing opener and the annual Willis Bunsen Grocery Run footrace.
